import React from 'react';

import mapMarking from '../images/map-marker.svg';

function OrphanagesMap() {
    return (
        <div id="page-map">
            <aside>
                <header>
                    <img src={mapMarking} alt=""/>
                </header>
            </aside>

        </div>
    );
}

export default OrphanagesMap;
